CREATE DEFINER=`root`@`localhost` PROCEDURE `Faktorial` (IN `n` INT)   BEGIN
    DECLARE i INT DEFAULT 1;
    DECLARE fact INT DEFAULT 1;
    
    WHILE i <= n DO
        SET fact = fact * i;
        SET i = i + 1;
    END WHILE;
    
    SELECT CONCAT(n, '! = ', fact) AS result;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `Grade` (`score` DOUBLE)   BEGIN
    DECLARE grade VARCHAR(2);
    
    IF score >= 90 AND score <= 100 THEN
        SET grade = 'A';
    ELSEIF score >= 85 AND score < 90 THEN
        SET grade = 'A-';
    ELSEIF score >= 80 AND score < 85 THEN
        SET grade = 'B+';
    ELSEIF score >= 75 AND score < 80 THEN
        SET grade = 'B';
    ELSEIF score >= 70 AND score < 75 THEN
        SET grade = 'B-';
    ELSEIF score >= 60 AND score < 70 THEN
        SET grade = 'C+';
    ELSEIF score >= 55 AND score < 60 THEN
        SET grade = 'C';
    ELSEIF score >= 45 AND score < 55 THEN
        SET grade = 'D';
    ELSE
        SET grade = 'E';
    END IF;
    
    SELECT grade AS result;
END$$

